import { View, Text, SafeAreaView } from "react-native";
import React, { useLayoutEffect } from "react";
import { useNavigation } from "@react-navigation/native";

const HomeScreen = () => {
  const navigation = useNavigation();

  useLayoutEffect(() => {
    navigation.setOptions({
      headerShown: false,
    });
  }, []);

  return (
    <SafeAreaView>
      <View className="bg-pink-600 container mx-auto">
        <Text>
          Lorem ipsum dolor sit amet consectetur adipisicing elit. Consectetur
          itaque, reprehenderit quibusdam tenetur magni voluptatibus. Quam
          eveniet asperiores quod exercitationem, quas neque earum quo sit cum,
          nostrum nulla! Aut eos incidunt sunt officia ut quaerat tempore eius,
          voluptates perspiciatis suscipit inventore minima error, architecto
          quos consectetur laboriosam repellat perferendis. Exercitationem alias
          animi sed obcaecati nulla rerum?
        </Text>
      </View>
    </SafeAreaView>
  );
};

export default HomeScreen;
